	def kwotaKredytuNetto = testRunner.testCase.getPropertyValue('wysokosc_raty').toDouble();
	zmienna = kwotaKredytuNetto - testRunner.testCase.getPropertyValue('modyfikacja_wartosci_suwaka').toDouble();
} 
return zmienna

